import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Grid,
  Paper,
  Button,
  Chip,
  TextField,
  InputAdornment
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import productos from '../../data/productos.json';

export default function Comprar() {
  const navigate = useNavigate();
  const isLoggedIn = Boolean(localStorage.getItem('token'));

  const handleCompra = (id) => {
    if (!isLoggedIn) {
      navigate('/login');
    } else {
      navigate(`/comprar/${id}`);
    }
  };

  return (
    <Box>
      {/* Encabezado institucional */}
      <Box
        sx={{
          width: '100%',
          px: 3,
          py: 2,
          borderBottom: '1px solid #ddd',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center'
        }}
      >
        <Typography
          variant="h6"
          component="a"
          href="/"
          sx={{
            textDecoration: 'none',
            color: '#2e7d32',
            fontWeight: 'bold',
            fontSize: '1.4rem',
            cursor: 'pointer',
            '&:hover': { textDecoration: 'underline' }
          }}
        >
          Mercado Agr√≠cola
        </Typography>

        <TextField
          placeholder="Buscar productos..."
          size="small"
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon sx={{ color: 'gray' }} />
              </InputAdornment>
            )
          }}
          sx={{
            width: { xs: '60%', md: '40%' },
            bgcolor: '#f1f8e9',
            borderRadius: 4
          }}
        />
      </Box>

      {/* Banner de pago */}
      <Box
        sx={{
          width: '100%',
          height: { xs: 180, md: 240 },
          backgroundImage: 'url("/imagenes/banner-pago.webp")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          display: 'flex',
          alignItems: 'flex-end',
          justifyContent: 'center',
          px: 2,
          py: 2
        }}
      >
        <Typography
          variant="h6"
          sx={{
            color: '#fff',
            backgroundColor: 'rgba(0,0,0,0.5)',
            px: 2,
            py: 1,
            borderRadius: 2,
            fontWeight: 'bold'
          }}
        >
          ¬øTransferencia o Tarjeta? ¬°T√∫ eliges!
        </Typography>
      </Box>

      {/* Categor√≠as visuales */}
      <Box sx={{ px: { xs: 2, md: 4 }, py: 4 }}>
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3 }}>
          Categor√≠as destacadas
        </Typography>
        <Grid container spacing={3}>
          {['Perro', 'Gato', 'Limpieza y Aseo', 'Jardiner√≠a'].map((cat, idx) => (
            <Grid item xs={6} sm={3} key={idx}>
              <Paper
                elevation={3}
                sx={{
                  p: 2,
                  borderRadius: 3,
                  textAlign: 'center',
                  cursor: 'pointer',
                  '&:hover': { boxShadow: 6 }
                }}
              >
                <img
                  src={`/imagenes/categorias/${cat.toLowerCase().replace(/ /g, '-')}.webp`}
                  alt={cat}
                  style={{ width: '100%', borderRadius: 8 }}
                />
                <Typography sx={{ mt: 1, fontWeight: 'bold' }}>{cat}</Typography>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Productos destacados */}
      <Box sx={{ px: { xs: 2, md: 4 }, pb: 6 }}>
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3 }}>
          Productos destacados
        </Typography>
        <Grid container spacing={4}>
          {productos.map((prod) => (
            <Grid item xs={12} sm={6} md={4} key={prod.id}>
              <Paper elevation={3} sx={{ p: 2, borderRadius: 3, position: 'relative' }}>
                <img
                  src={prod.imagen}
                  alt={prod.nombre}
                  style={{ width: '100%', borderRadius: 8, objectFit: 'cover' }}
                />
                <Typography variant="h6" sx={{ mt: 2, fontWeight: 'bold' }}>
                  {prod.nombre}
                </Typography>
                <Typography variant="body2" sx={{ color: 'text.secondary', mb: 1 }}>
                  Precio: {prod.precio} USD
                </Typography>
                {prod.descuento && (
                  <Chip
                    label={`-${prod.descuento}%`}
                    color="error"
                    size="small"
                    sx={{ position: 'absolute', top: 10, right: 10 }}
                  />
                )}
                {isLoggedIn ? (
                  <Button
                    variant="contained"
                    color="success"
                    fullWidth
                    onClick={() => handleCompra(prod.id)}
                    sx={{
                      borderRadius: 30,
                      py: { xs: 1, md: 1.5 },
                      fontWeight: 'bold',
                      fontSize: { xs: '0.9rem', md: '1rem' },
                      mt: 2
                    }}
                  >
                    Comprar
                  </Button>
                ) : null}
              </Paper>
            </Grid>
          ))}
        </Grid>
        {!isLoggedIn && (
          <Box sx={{ mt: 4, textAlign: 'center' }}>
            <Typography variant="body1" sx={{ mb: 1 }}>
              Debes iniciar sesi√≥n para realizar compras üîê
            </Typography>
            <Button
              variant="outlined"
              href="/login"
              sx={{
                color: '#2e7d32',
                borderColor: '#2e7d32',
                fontWeight: 'bold',
                '&:hover': { backgroundColor: '#e8f5e9', borderColor: '#1b5e20' }
              }}
            >
              Iniciar sesi√≥n
            </Button>
          </Box>
        )}
      </Box>
    </Box>
  );
}
